func worker(ports, results chan int, address string, wg *sync.WaitGroup) {
    // Close the WaitGroup finally
    defer wg.Done()

    // Loop through the ports channel until it's closed
    for p := range ports {
        addr := fmt.Sprintf("%s:%d", address, p)

        // Attempt to connect to the address for specified port
        conn, err := net.DialTimeout("tcp", addr, 1000*time.Millisecond)

        // If successful connected, pass port through the results channel
        if err == nil {
            conn.Close()
            results <- p
        }
    }
}

